    "Kanuti NWR waterfowl brood survey of Kanuti River, 7/11/85-7/21/85",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:02:48.711940",nt"name": "kanuti-nwr-waterfowl-brood-survey-of-kanuti-river-7-11-85-7-21-85",nt"isopen":
    false,nt"url": null,nt"notes": "This year's brood count very likely gives
    a more thorough inventory of lake production than do the last two year's counts:
    whereas most lakes were spot surveyed from shore in 1983 and 1984, almost all lake
    shorelines were completely canoed in 1985. On all the lakes inventoried, duck production
    was significantly higher in 19BS (.61 young/acre on 71 lakes) than in 1984 (.37
    young/acre on 9 lakes). However, a direct comparison of the 11 lakes which were
    surveyed in both year's shows that duck production did not increase {.44 young/acre
    in both years), and in view of the more thorough survey method this year, actual
    production probably decreased. Goose production on lakes also appears to have dropped
    in 1985; but it should be noted that young geese escape on land more readily than
    young ducks, so 1984's spot surveys may not have spooked as many goose broods as
    this year's canoe surveys. Both duck and goose production on the Kanuti River were
    lower this year than last. The survey method was essentially the same in both years.
    White-fronted Goose production fell drastically from.05 young/acre in 1984 to.01
    young/acre in 1985.",nt"license_title": "License Not Specified",nt"extras":
